import React from "react";
import { Link } from "react-router-dom";

//Componente de Página principal
export const Home = () => {
  return (
    <main>
      <figure>
        <img alt="Logo"/>
      </figure>
      <section>
        <section>
          <h1>Selecciona una opción</h1>
          <div>
            <Link to="/waiter">
              <img alt="meserx" />
              Meserx
            </Link>
            <Link to="/kitchen">
              <img alt="chef" />
              Cocina
            </Link>
          </div>
        </section>
      </section>
    </main>
  );
};
